import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          {/* <Route path={'/'} element={'component'} /> */}
        </Routes>
        <h1>Cosas Chanchas</h1>
      </div>
    </BrowserRouter>
  );
}

export default App;
